  \"2015-09-27T01:57:35.188912\",\n\t\"name\": \"natural-hazards-image-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Photographs and other visual media provide
  valuable pre- and post-event data for natural hazards. Research, mitigation, and
  forecasting rely on visual data for post-analysis, inundation mapping and historic
  records. Instrumental data only reveal a portion of the whole story; photographs
  explicitly illustrate the physical and societal impacts from an event.           n
  \         This resource provides high-resolution geologic and damage photographs
  from natural hazards events, including earthquakes, tsunamis, slides, volcanic eruptions
  and geologic movement (faults, creep, subsidence and flows). The earliest images
  date back to 1886. Each event also links to NGDC's Global Historical hazards databases,
  which provide details for these events.\",\n\t\"license_title\": null,\n\t\"extras\":
